import List from "./Components/Restaurants/List";

function App() {
  return (
    <div className="App">
    <h1 className="geeks">GeeksforGeeks </h1>
    <h3>CRUD App</h3>
    <Router>
        <Routes>
            <Route path="/" element={<List />} />
            <Route
                path="/create"
                element={<Create />}
            />
            <Route
                path="/edit"
                element={<Edit />}
            />
        </Routes>
    </Router>
</div>
  );
}

export default App;
